class NewProducts extends React.Component {
  render() {
    return (
      <div className="mainContentbg">
        <div className="container">
          <h1 className="text-center text-white p-5">最新產品</h1>

        </div>
        <hr className="hrLine" />
      </div>
    );
  }
}

export default NewProducts;
